import React, { useState, useEffect } from 'react';

const AdminDashboard = () => {
  const [tasks, setTasks] = useState([]);
  const [analytics, setAnalytics] = useState({
    pending: 0,
    scheduled: 0,
    completed: 0
  });

  useEffect(() => {
    // Fetch tasks from the backend
    fetch('http://your-backend-api/tasks', {
      method: 'GET',
      headers: {
        'Content-Type': 'application/json',
        'Authorization': `Bearer ${localStorage.getItem('token')}` // JWT token
      }
    })
    .then(response => response.json())
    .then(data => {
      setTasks(data.tasks);
      // Calculate analytics
      const pending = data.tasks.filter(task => task.task_status === 'pending').length;
      const scheduled = data.tasks.filter(task => task.task_status === 'scheduled').length;
      const completed = data.tasks.filter(task => task.task_status === 'completed').length;
      setAnalytics({ pending, scheduled, completed });
    })
    .catch(error => console.error('Error fetching tasks:', error));
  }, []);

  return (
    <div className="p-8 bg-gray-900 text-gray-100 min-h-screen">
      <h1 className="text-3xl font-bold mb-8">Admin Dashboard</h1>
      <div className="grid grid-cols-1 md:grid-cols-3 gap-4 mb-8">
        <div className="bg-gray-800 p-4 rounded shadow">
          <h2 className="text-xl font-semibold">Pending Tasks</h2>
          <p className="text-2xl">{analytics.pending}</p>
        </div>
        <div className="bg-gray-800 p-4 rounded shadow">
          <h2 className="text-xl font-semibold">Scheduled Tasks</h2>
          <p className="text-2xl">{analytics.scheduled}</p>
        </div>
        <div className="bg-gray-800 p-4 rounded shadow">
          <h2 className="text-xl font-semibold">Completed Tasks</h2>
          <p className="text-2xl">{analytics.completed}</p>
        </div>
      </div>
      <table className="w-full bg-gray-800 rounded shadow">
        <thead>
          <tr>
            <th className="py-2 px-4 border-b border-gray-700">Task Name</th>
            <th className="py-2 px-4 border-b border-gray-700">Description</th>
            <th className="py-2 px-4 border-b border-gray-700">Status</th>
            <th className="py-2 px-4 border-b border-gray-700">Schedule</th>
            <th className="py-2 px-4 border-b border-gray-700">Assigned User</th>
            <th className="py-2 px-4 border-b border-gray-700">Email</th>
          </tr>
        </thead>
        <tbody>
          {tasks.map(task => (
            <tr key={task.id}>
              <td className="py-2 px-4 border-b border-gray-700">{task.task_name}</td>
              <td className="py-2 px-4 border-b border-gray-700">{task.task_description}</td>
              <td className="py-2 px-4 border-b border-gray-700">{task.task_status}</td>
              <td className="py-2 px-4 border-b border-gray-700">{task.task_schedule}</td>
              <td className="py-2 px-4 border-b border-gray-700">{task.assigned_user_name}</td>
              <td className="py-2 px-4 border-b border-gray-700">{task.assigned_user_email}</td>
            </tr>
          ))}
        </tbody>
      </table>
      <button
        className="bg-teal-600 hover:bg-teal-700 text-gray-100 font-bold py-2 px-4 rounded-full focus:outline-none focus:shadow-outline mt-4"
        onClick={() => alert('Open create task popup')}
      >
        + Create Task
      </button>
    </div>
  );
};

export default AdminDashboard;
